import React from 'react'
import HomeStyle from '../css/Home.css'
import {Container} from 'react-bootstrap'

class Home extends React.Component {
	render() {
		return (
			<Container className="homeContainer">
			<p>Hello World</p>
			</Container>
		)
	}
}

export default Home
